import './Error.css'
import {useNavigate} from 'react-router-dom'
function Error() {
  const navigate = useNavigate();
const goback = () =>{
navigate('/');
} ;
  
  return (
    <>
      <div id='error'>
        <div id='Error'>4<span>0</span>4</div>
        <h3>ERROR</h3>
        <p>Page <span>Not</span> found </p>
        <button id='btn' onClick={()=>goback()}>Go Back</button> 
      </div>
     
     
    </>
  )
}

export default Error
